'use strict';

var app = angular.module('socialApp', ['ngRoute', 'ngResource', 'ngStorage', 'naif.base64']);

app.constant('baseServiceUrl', 'http://softuni-social-network.azurewebsites.net/api/');
app.constant('profileImage', "");
app.constant('coverImage', "");

if(!localStorage['ngStorage-access_token']){
    app.config(['$routeProvider', function($routeProvider){
        $routeProvider.when('/', {
            templateUrl: 'templates/public/welcome.html'
        });
        $routeProvider.otherwise({
            redirectTo: '/'
        });
    }]);
} else{
    app.config(['$routeProvider', function($routeProvider){
        $routeProvider.when('/', {
            templateUrl: 'templates/user/home.html'
        });
        $routeProvider.when('/users/:username', {
            templateUrl: 'templates/user/wall.html',
            controller: 'WallController'
        });
        $routeProvider.when('/users/:username/friends', {
            templateUrl: 'templates/user/friends.html',
            controller: 'FriendsController'
        });
        $routeProvider.when('/profile', {
            templateUrl: 'templates/user/edit-profile.html',
            controller: 'EditProfileController'
        });
        $routeProvider.when('/profile/password', {
            templateUrl: 'templates/user/change-password.html',
            controller: 'ChangePassController'
        });
        $routeProvider.when('/logout', {
            templateUrl: 'templates/user/logout.html',
            controller: 'LogoutController'
        });
        $routeProvider.otherwise({
            redirectTo: '/'
        });
    }]);

app.config(['$httpProvider', function($httpProvider) {
        $httpProvider.interceptors.push(function($q, $timeout, $window, $location, $sessionStorage, $localStorage) {
            return {
                'responseError': function(rejection){
                    var defer = $q.defer();
                    if(rejection.status == 401){
                        $localStorage.$reset();
                        $sessionStorage.$reset();
                        $timeout(function () {
                            $window.location.reload();
                        }, 1000);
                    }
                    defer.reject(rejection);
                    return defer.promise;
                }
            };
        });
    }])
}
